(function( $ ) {
    'use strict';
    // Cache selections so we don't have to keep looking them up.
    var $navToggleButton    = $( '#navbar-toggle' ),
        $navOverlay         = $( '.nav-overlay' ),
        $overlayCloseButton = $( '.overlay-close');
    /**
     * Open the menu overlay.
     */
    function openOverlay() {
        $navToggleButton.attr( 'aria-expanded', 'true' );
        $navOverlay.attr( 'aria-hidden', 'false' ).show("true");
       
    }
    /**
     * Close the menu overlay.
     */
    function closeOverlay() {
       $navOverlay.attr('aria-hidden', 'true' );
       $navToggleButton.attr('aria-expanded', 'false' ).show("true");
  
    }
    /**
     * Bind events to behaviour.
     */
    function ready() {
        $navToggleButton.on( 'click.deakinlock', openOverlay ); 
        $overlayCloseButton.on( 'click.deakinlock', closeOverlay ); 
    }
    // Bind behaviour at document ready.
    $( ready );
})( jQuery );


    

